import React from 'react';

const Organization = () => (
    <div style={{backgroundColor: 'black'}} className="organization-container">
        <div
            style={{
                backgroundColor: 'white',
                border: 2,
                width: '100%',
                height: 400,
                flexBasis: "40%"
            }}
        >
            1
        </div>
        <div
            style={{backgroundColor: 'red', border: 2, width: '100%', height: 400}}
        >
            2
        </div>
    </div>
);
export default Organization;
